import styles from './index.css'; 
import btc from './images/bitcoin.png'

const Navbar = () => {
  return (
    <div class="NavBar" style={styles.NavBar}>
       <div style={{border: '1 solid gray', width: 20, }}>
        <img src={btc}></img>

       </div>
    </div>
  );
};

export default Navbar;
